require('./phaser.min.js')

var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function() {
    // game configuration object
    var gameConfig = {
       type: Phaser.CANVAS,
       width: 512,
       height: 750,
       backgroundColor: 0xFFFFFF,
       scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {
    
    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        // bg and scene sprites
        this.textures.addBase64('bg', assets.bg);
        this.textures.addBase64('diff1', assets.diff1);
        this.textures.addBase64('diff2', assets.diff2);
        this.textures.addBase64('diff3', assets.diff3);
        this.textures.addBase64('man', assets.man);
        this.textures.addBase64('icon', assets.icon);

        // guide
        this.textures.addBase64('circle', assets.circle);

        // ui
        this.textures.addBase64('right', assets.right);
        this.textures.addBase64('wrong', assets.wrong);
        this.textures.addBase64('win_bg', assets.win_bg);
        this.textures.addBase64('btn_download', assets.btn_download);
        this.textures.addBase64('btn_retry', assets.btn_retry);

        var imageCount = 12;
        var loadedCount = 0;
        this.textures.on('addtexture', function() {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        var picture_width = 512;
        var picture_height = 342;
        var spacing = 66;
        var pic1_start = game.config.height / 2 - spacing / 2 - picture_height;
        var pic2_start = game.config.height / 2 + spacing / 2;
        this.add.image(0, pic1_start, 'bg').setOrigin(0, 0);
        this.add.image(0, pic2_start, 'bg').setOrigin(0, 0);
        this.add.image(120, game.config.height / 2, 'icon');
        var text = this.add.text(game.config.width/2 + 50, game.config.height/2, 'Find The Differences', { fontStyle: 'bold', fontSize: '24px', fill: '#4AA8F1' }).setOrigin(0.5, 0.5);

        var diff_pos1 = { x: 282, y: 242 };
        var diff_pos2 = { x: 108, y: 254 };
        var diff_pos3 = { x: 57, y: 189 };
        this.diff1 = this.add.image(diff_pos1.x, pic1_start + diff_pos1.y, 'diff1').setInteractive({draggable: true});
        this.diff2 = this.add.image(diff_pos2.x, pic2_start + diff_pos2.y, 'diff2').setInteractive({draggable: true});
        this.diff3 = this.add.image(diff_pos3.x, pic1_start + diff_pos3.y, 'diff3').setInteractive({draggable: true});

        this.guide = this.add.sprite(diff_pos3.x, pic1_start + diff_pos3.y, 'circle').setInteractive({draggable: true});
        this.guideScale();

        this.diff1_found = false;
        this.diff2_found = false;
        this.diff3_found = false;
        this.input.on('pointerdown', function (pointer) {
            if (this.count >= 3) {
                return;
            }
            
            if (!this.diff1_found && (this.in_area(pointer, diff_pos1, pic1_start) || this.in_area(pointer, diff_pos1, pic2_start))) {
                this.diff1_found = true;
                this.showCorrect(diff_pos1.x, pic1_start + diff_pos1.y);
                this.showCorrect(diff_pos1.x, pic2_start + diff_pos1.y);
                this.clickDiff();
                return;
            }

            if (!this.diff2_found && (this.in_area(pointer, diff_pos2, pic1_start) || this.in_area(pointer, diff_pos2, pic2_start))) {
                this.diff2_found = true;
                this.showCorrect(diff_pos2.x, pic1_start + diff_pos2.y);
                this.showCorrect(diff_pos2.x, pic2_start + diff_pos2.y);
                this.clickDiff();
                return;
            }

            if (!this.diff3_found && (this.in_area(pointer, diff_pos3, pic1_start) || this.in_area(pointer, diff_pos3, pic2_start))) {
                this.diff3_found = true;
                this.guide.setVisible(false);
                this.showCorrect(diff_pos3.x, pic1_start + diff_pos3.y);
                this.showCorrect(diff_pos3.x, pic2_start + diff_pos3.y);
                this.clickDiff();
                return;
            }

            var wrong = this.add.image(pointer.x, pointer.y, 'wrong');
            this.tweens.add({
                targets: [wrong],
                rotation: 0.15,
                duration: 100,
                callbackScope: this,
                onComplete: function(tween) {
                    this.tweens.add({
                        targets: [wrong],
                        rotation: -0.15,
                        duration: 100,
                        callbackScope: this,
                        onComplete: function(tween) {
                            wrong.destroy();
                        }
                    });
                }
            });
        }, this);

        this.count = 0;

        resize();
        window.addEventListener("resize", resize, false);
    }

    in_area(pointer, pos, offsetY) {
        var centerX = pos.x;
        var centerY = pos.y + offsetY;
        var range = 30;
        return (pointer.x < centerX + range)
            && (pointer.x > centerX - range)
            && (pointer.y < centerY + range)
            && (pointer.y > centerY - range);
    }

    showCorrect(x, y) {
        var right = this.add.image(x, y, 'right');
        right.scaleX = 0.6;
        right.scaleY = 0.6;
        this.tweens.add({
            targets: [ right ],
            scaleX: 1,
            scaleY: 1,
            duration: 250,
            ease: 'Back'
        });
    }

    guideScale() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1.2,
            scaleY: 1.2,
            duration: 400,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScaleBack();
            }
        });
    }

    guideScaleBack() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1,
            scaleY: 1,
            duration: 500,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScale();
            }
        });
    }

    clickDiff() {
        if (this.count >= 3) {
            return;
        }
        this.count++;
        if (this.count == 3) {
            this.showMan();
            this.time.delayedCall(750, this.showWin, null, this);
        }
    }

    showMan() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({ fillStyle: { color: 0x000000 } });
        graphics.alpha = 0.5;
        graphics.fillRectShape(rect);

        var man = this.add.sprite(game.config.width/2 - 400, game.config.height/2 + 200, "man");
        man.setDepth(10);

        this.tweens.add({
            targets: [man],
            x: game.config.width/2 - 180,
            duration: 400
        });
    }

    showWin() {
        var winPanel = this.add.sprite(game.config.width/2, game.config.height/2 + 500, "win_bg");
        winPanel.setDepth(10);

        // show panel
        this.tweens.add({
            targets: [winPanel],
            y: game.config.height/2 - 50,
            duration: 400,
            ease: 'Back',
            callbackScope: this,
            onComplete: function(tween) {
                var downloadBtn = this.add.sprite(game.config.width/2 + 42, game.config.height/2 + 100, 'btn_download').setInteractive();
                downloadBtn.setDepth(11);
                downloadBtn.on('pointerdown', function(pointer) {
                    // FbPlayableAd.onCTAClick();
                    ExitApi.exit()
                }, this);
                downloadBtn.on('touchstart', function(pointer) {
                    // FbPlayableAd.onCTAClick();
                    ExitApi.exit()
                }, this);
        
                var retryBtn = this.add.sprite(game.config.width/2 - 87, game.config.height/2 + 100, 'btn_retry').setInteractive();
                retryBtn.setDepth(11);
                retryBtn.on('pointerdown', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);
                retryBtn.on('touchstart', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);

                downloadBtn.scaleX = 0.8;
                downloadBtn.scaleY = 0.8;
                retryBtn.scaleX = 0.8;
                retryBtn.scaleY = 0.8;
                this.tweens.add({
                    targets: [ downloadBtn, retryBtn ],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 250,
                    ease: 'Back'
                });
            }
        });
    }
}

function resize() {
    var canvas = document.querySelector("canvas");
    var windowWidth = window.innerWidth;
    var windowHeight = window.innerHeight;
    var windowRatio = windowWidth / windowHeight;
    var gameRatio = game.config.width / game.config.height;
    if(windowRatio < gameRatio){
        canvas.style.width = windowWidth + "px";
        canvas.style.height = (windowWidth / gameRatio) + "px";
    }
    else{
        canvas.style.width = (windowHeight * gameRatio) + "px";
        canvas.style.height = windowHeight + "px";
    }
}

var assets = {"wrong": "data:image/png;base64,", "diff2": "data:image/png;base64,", "diff3": "data:image/png;base64,", "diff1": "data:image/png;base64,", "icon": "data:image/png;base64,", "btn_retry": "data:image/png;base64,", "btn_download": "data:image/png;base64,", "circle": "data:image/png;base64,", "win_bg": "data:image/png;base64,", "man": "data:image/png;base64,", "right": "data:image/png;base64,", "bg": "data:image/png;base64,"}